  // Fixed in safari, after multiple clicks , the loader still has not disappeared.\n  .safari-visibility(hidden);\n}\n\n.padding-vertical(@padding-vertical) {\n  padding-top: @padding-vertical;\n  padding-bottom: @padding-vertical;\n}\n\n.padding-horizontal(@padding-vertical) {\n  padding-left: @padding-vertical;\n  padding-right: @padding-vertical;\n}\n\n.icon-bolder(@width:2px) {\n  stroke: currentColor;\n  stroke-width: @width;\n  stroke-linecap: round;\n}\n\n// Useful when adding focus ring to an element\n.with-focus-ring() {\n  &:focus-visible {\n    .focus-ring();\n  }\n}\n\n// Useful when appending the ring into an existing :focus rule\n.focus-ring() {\n  outline: 3px solid var(--rs-color-focus-ring);\n  // box-shadow: var(--rs-state-focus-shadow);\n\n  .high-contrast-mode({\n    outline-offset: 2px;\n  });\n}\n\n.focus-ring(slim) {\n  .focus-ring();\n\n  outline-width: 2px;\n  outline-offset: 0;\n}\n\n.focus-ring(inset) {\n  .focus-ring();\n\n  outline-offset: -3px;\n}\n\n.focus-ring(slim-inset) {\n  .focus-ring(inset);\n\n  outline-width: 2px;\n}\n\n.focus-ring(outline) {\n  outline: var(--rs-state-focus-outline);\n}\n\n// Removes the focus ring\n.unset-focus-ring() {\n  box-shadow: none;\n  outline: none;\n}\n","// Rules that take effect in dark mode.\n.dark-mode(@rules) {\n  & when (@enable-dark-mode = true) {\n    .rs-theme-dark & {\n      @rules();\n    }\n  }\n}\n\n.high-contrast-mode(@rules) {\n  .rs-theme-high-contrast & {\n    @rules();\n  }\n}\n","@import '../../styles/common';\n@import 'mixin';\n\n.rs-avatar {\n  background-color: var(--rs-avatar-bg);\n  color: var(--rs-avatar-text);\n  display: inline-flex;\n  justify-content: center;\n  align-items: center;\n  border-radius: 4px;\n  overflow: hidden;\n  position: relative;\n\n  .avatar-md();\n\n  & > .rs-icon {\n    vertical-align: middle;\n  }\n\n  &-image {\n    &::before {\n      content: attr(alt);\n      position: absolute;\n      width: 100%;\n      height: inherit;\n      top: 0;\n      